use gtk::{gdk, gio};

/// Initialized the icons and registers them globally for your application.
pub fn initialize_icons() {
    gio::resources_register_include!("resources.gresource").unwrap();

    let display = gdk::Display::default().unwrap();
    let theme = gtk::IconTheme::for_display(&display);
    theme.add_resource_path("/relm4/icons/");
}

#[cfg(all(test, feature = "arrow-circle-right-filled", feature = "work-week"))]
mod test {
    use super::*;

    #[test]
    fn test() {
        gtk::init().unwrap();

        initialize_icons();

        let display = gdk::Display::default().unwrap();
        let theme = gtk::IconTheme::for_display(&display);
        assert!(theme.has_icon("arrow-circle-right-filled-symbolic"));
        assert!(theme.has_icon("work-week-symbolic"));
    }
}

